import { Component, Input } from '@angular/core';
import { FrameInfo } from '../models/frame-info'

@Component({
  selector: 'app-frame',
  templateUrl: './frame.component.html',
  styleUrls: ['./frame.component.css']
})
export class FrameComponent {
  @Input() frame: FrameInfo = new FrameInfo();
}
<div>
  <p>{{frame.frameNumber}}</p>
  <input type="text" [(ngModel)]="frame.scores[0]" />
  <input type="text" [(ngModel)]="frame.scores[1]" />
  <input type="text" [(ngModel)]="frame.scores[2]" />
</div>
